type RootState = {
  articlesReducer: {
    data: {
      articles: object[];
    };
  };
};

export const Article: React.FC = () => {
  const article = useSelector(
    (state: RootState) => state.articlesReducer.data.articles
  );

  return <li>1</li>;
};
